<p>在盒餐老师离开后，甚平老师的代课和玄鸟同学作为助教的加入，为0班带来了新的变化。玄鸟和薮雨以<strong>随心所欲</strong>的态度处理着各种事务，逐渐赢得了同学们的支持。</p>
